import React, { Component } from 'react';
import { Tab, Tabs } from '@blueprintjs/core';

import MainDashboard from './components/MainDashboard';
import TestView2 from './components/TestComponent2';
import TestView3 from './components/TestComponent3';
import TestView4 from './components/TestComponent4';
import Sidebar from '../../components/Sidebar/Sidebar';
import SidebarItem from '../../components/Sidebar/SidebarItem';

export default class Dashboards extends Component {
   state = { activeTabID: 1, selected: 1 };
   //handleTabChange = TabId => this.setState({ activeTabID: 1 });
   changeSelection(id) {
      this.setState({ selected: id });
   }
   render() {
      return (
         <div>
            <Sidebar>
               <SidebarItem
                  icon='dashboard'
                  selected={this.state.selected === 1}
                  onClick={() => this.changeSelection(1)}
               />
               <SidebarItem
                  icon='projects'
                  selected={this.state.selected === 2}
                  onClick={() => this.changeSelection(2)}
               />
               <SidebarItem
                  icon='join-table'
                  selected={this.state.selected === 3}
                  onClick={() => this.changeSelection(3)}
               />
               <SidebarItem
                  icon='locate'
                  selected={this.state.selected === 4}
                  onClick={() => this.changeSelection(4)}
               />
               <SidebarItem
                  icon='cog'
                  selected={this.state.selected === 5}
                  onClick={() => this.changeSelection(5)}
               />
               <SidebarItem
                  icon='wrench'
                  selected={this.state.selected === 6}
                  onClick={() => this.changeSelection(6)}
               />
               <SidebarItem
                  icon='user'
                  selected={this.state.selected === 7}
                  onClick={() => this.changeSelection(7)}
               />
            </Sidebar>
         </div>
      );
   }
}
